SELECT COUNT(DISTINCT eixo_1.calculation_838513981462429699) AS ctdcalculation_838513981462429699ok,   eixo_1.eixo_tecnologico_catalogo_guia AS eixo_tecnologico_catalogo_guia,   eixo_1.eixo_tecnolgico AS eixo_tecnolgico,   eixo_1.nome_curso_catalogo_guia AS nome_curso_catalogo_guia,   eixo_1.subtipo_curso AS subtipo_curso FROM eixo_1 WHERE ((eixo_1.eixo_tecnologico_catalogo_guia IN ('Hospitalidade e Lazer', 'Turismo, Hospitalidade e Lazer')) AND (eixo_1.eixo_tecnolgico = 'Turismo, Hospitalidade e Lazer') AND (NOT ((eixo_1.nome_da_sit_matricula_situacao_detalhada IN ('CANC_DESISTENTE', 'CANC_MAT_PRIM_OPCAO', 'CANC_SANO', 'CANC_SEM_FREQ_INICIAL', 'CANC_TURMA', 'DOC_INSUFIC', 'ESCOL_INSUFIC', 'INC _ITINERARIO', 'INSC_CANC', 'No Matriculado', 'NO_COMPARECEU', 'TURMA_CANC', 'VAGAS_INSUFIC')) OR (eixo_1.nome_da_sit_matricula_situacao_detalhada IS NULL))) AND (NOT (eixo_1.situacao_da_turma IN ('CANCELADA', 'CRIADA', 'PUBLICADA'))) AND (CAST(EXTRACT(YEAR FROM eixo_1.data_de_inicio) AS LONG) IN (2009, 2010, 2011, 2012, 2013, 2014, 2015, 2016))) GROUP BY eixo_tecnologico_catalogo_guia,   eixo_tecnolgico,   nome_curso_catalogo_guia,   subtipo_curso;
